import React from 'react';
import { Link } from 'react-router-dom';
import { useEffect } from 'react';
import { useDispatch } from 'react-redux';
import { getVideogames } from '../actions';

export default function LandingPage() {
    const dispatch = useDispatch();
    useEffect(() => dispatch(getVideogames()), [dispatch])
    return (
        <div>
            <h1>Welcome to my Videogames App</h1>
            <video id="video" loop autoplay preload muted>
                <source src="../media/videoback.mp4" type='video/mp4; codecs="avc1,mp4a"' />
                <source src="../media/videoback.ogg" type='video/ogg; codecs="theora,vorbis"' />
                <source src="../media/videoback.webm" type='video/webm; codecs="vp8,vorbis"' />
            </video>
            <Link to='/home'>Get me in!!</Link>
        </div>
    )
}
